import React, { Component } from "react";

const Filter = ({ launch_year }) => {
  return (
    <div className="border bg-light p-2 ">
      <h2>Filters</h2>
      <div className="row">
        {launch_year.map((year) => (
          <button className="btn btn-primary col-5">{year}</button>
        ))}
      </div>
    </div>
  );
};

export default Filter;
